import React from "react"
import { Form, Input, Button, Card } from 'antd';

const PostBike = () => {
    return (
        <div>
            <Card size="large">
                <Input placeHolder="Year"/>
                <Input placeHolder="Make"/>
                <Input placeHolder="Model"/>
                <Button type="primary">Add Bike</Button>                
            </Card>
        </div>
    )
}

export default PostBike
